import React from 'react';
import { Container, Row } from 'reactstrap';
import { NavLink, Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';

const navLinks = [
    {
        path: '/home',
        display: 'Home'
    },
    {
        path: '#',
        display: 'About'
    },
    {
        path: '/tours',
        display: 'Tours'
    }
];

const Header = () => {
    return (
        <header className="header"> {/* Corrected classname to className */}
            <Container>
                <Row>
                    <div className="nav__wrapper d-flex align-items-center justify-content-between"> {/* Corrected "nav__wraprer" to "nav__wrapper" */}
                        {/*============= Logo//////////*/}
                        <div className="logo">
                            <img src={logo} alt="" />
                        </div>
                        {/*============= Logo end//////////*/}
                    </div>
                </Row>
            </Container>
        </header>
    );
}

export default Header;
